export const initialState = {
    basket: [],
};
function reducer(state, action) {
    switch(action.type){
        case 'ADD_TO_BASKET':
          break;
        case 'REMOVE FROM BASKET':
          break;
          default:
              return state;
    }
}

export default reducer;
